package br.com.restaurante.model;import java.util.Date;import java.util.List;import br.com.topsys.util.TSDateUtil;import br.com.topsys.util.TSParseUtil;@SuppressWarnings("serial")public class AtendimentoModel extends BaseModel implements CrudModel<AtendimentoModel> {	private FuncionarioModel funcionarioModel;	private UsuarioModel usuarioResponsavelModel;	private StatusAtendimentoModel statusAtendimentoModel;	private OrigemModel origemModel;		private Date data;	private List<AtendimentoModel> historico;		private List<QuizQuestionarioModel> questionarios;		private List<SolicitacaoExameModel> solicitacoesExame;		private Boolean flagPossuiExames;	public AtendimentoModel(OrigemModel origemModel) {		super();		this.origemModel = origemModel;	}	public AtendimentoModel() {		super();	}	public FuncionarioModel getFuncionarioModel() {		return funcionarioModel;	}	public void setFuncionarioModel(FuncionarioModel funcionarioModel) {		this.funcionarioModel = funcionarioModel;	}	public Date getData() {		return data;	}	public void setData(Date data) {		this.data = data;	}	public StatusAtendimentoModel getStatusAtendimentoModel() {		return statusAtendimentoModel;	}	public void setStatusAtendimentoModel(StatusAtendimentoModel statusAtendimentoModel) {		this.statusAtendimentoModel = statusAtendimentoModel;	}	public List<AtendimentoModel> getHistorico() {		return historico;	}	public void setHistorico(List<AtendimentoModel> historico) {		this.historico = historico;	}	public UsuarioModel getUsuarioResponsavelModel() {		return usuarioResponsavelModel;	}	public void setUsuarioResponsavelModel(UsuarioModel usuarioResponsavelModel) {		this.usuarioResponsavelModel = usuarioResponsavelModel;	}	public OrigemModel getOrigemModel() {		return origemModel;	}	public void setOrigemModel(OrigemModel origemModel) {		this.origemModel = origemModel;	}	public List<QuizQuestionarioModel> getQuestionarios() {		return questionarios;	}	public void setQuestionarios(List<QuizQuestionarioModel> questionarios) {		this.questionarios = questionarios;	}	public List<SolicitacaoExameModel> getSolicitacoesExame() {		return solicitacoesExame;	}	public void setSolicitacoesExame(List<SolicitacaoExameModel> solicitacoesExame) {		this.solicitacoesExame = solicitacoesExame;	}	public Boolean getFlagPossuiExames() {		return flagPossuiExames;	}	public void setFlagPossuiExames(Boolean flagPossuiExames) {		this.flagPossuiExames = flagPossuiExames;	}	public String getInformacoes() {		StringBuilder texto = new StringBuilder();		texto.append("Código: ").append(this.id);		texto.append("<br/>Cadastrado às ").append(TSParseUtil.dateToString(this.dataCadastro, TSDateUtil.DD_MM_YYYY_HH_MM)).append(" por ").append(this.usuarioCadastroModel.getNome());		texto.append("<br/>Alterado às ").append(TSParseUtil.dateToString(this.dataAtualizacao, TSDateUtil.DD_MM_YYYY_HH_MM)).append(" por ").append(this.usuarioAtualizacaoModel.getNome());		return texto.toString();	}}